        {/* <Link href={'/students'}> */}
        <Button as="link" variant="solid">
          Tester Button Solid</Button>
        {/* </Link> */}

        <Button variant="outline">Tester Button Outline</Button>
      </div>
    )
  }
}

export default Home;
